# Extraer tensiones y corrientes
voltages = np.array([((entry[0]*12)-3.8) for entry in data])
currents = np.array([((entry[1]-1.228)/2000) for entry in data])

# Calcular ln(corriente) y su derivada
ln_currents = np.log(currents)
derivative_ln_current = np.gradient(ln_currents, voltages)  # Derivada de ln(I) con respecto a V

# Calcular la inversa de la derivada
inverse_derivative = 1 / derivative_ln_current

# Crear la figura y el primer eje Y
plt.figure(figsize=(10, 6))
ax1 = plt.gca()

# Grfico de ln(Corriente) con el primer eje Y (a la izquierda)
ax1.plot(voltages, currents, label='Reverse IV', color='blue')
ax1.set_xlabel('Tensin (V)')
ax1.set_ylabel('ln(Corriente)', color='blue')
ax1.tick_params(axis='y', labelcolor='blue')

# Crear el segundo eje Y a la derecha
ax2 = ax1.twinx()

# Grfico de la derivada de ln(Corriente) con el segundo eje Y (a la derecha)
ax2.plot(voltages, derivative_ln_current, label='Derivada de ln(Corriente)', color='red')

# Grfico de la inversa de la derivada con el segundo eje Y (a la derecha)
ax2.plot(voltages, inverse_derivative, label='Inversa de la Derivada', color='green')

# Configurar el eje Y derecho
ax2.set_ylabel('Derivada y Inversa Derivada', color='red')
ax2.tick_params(axis='y', labelcolor='red')

# Leyenda
ax1.legend(loc='upper left')
ax2.legend(loc='upper center')

# Ttulo y mostrar la grfica
plt.title('Curvas IV del SiPM y su Derivada')
plt.grid(True)
plt.show()
